import { useEffect,useState} from "react";
import axios from 'axios';
const Main=async()=>{
    const [data,setdata] =useState();
    useEffect(()=>{
        async function fetch(){
            const profile = await axios.get(`http://localhost/profile`);
            console.log(profile);
            setdata(profile);
        }

    })

    return(<>
       console.log(data);
    </>)

}
export default Main;
